import React from "react";
import Login from "./components/Login";
import Register from "./components/Register";
import AddBlog from "./component/AddBlog";


const HomePage = () => {
  return (
    <div className="home-container">
      <div id="home">
        <h1 className="home-title">ðŸ“– Welcome to My Blog</h1>
        <p className="home-subtitle">
          Read, write, and share your thoughts with the world.
        </p>
      </div>

      <div className="section" id="login">
        <h2>Login</h2>
        <Login />
      </div>

      <div className="section" id="register">
        <h2>Register</h2>
        <Register />
      </div>

      <div className="section" id="add-blog">
        <h2>Add Blog</h2>
        <AddBlog />
      </div>

      <div className="section" id="posts">
        <h2>All Blog Posts</h2>
        <PostList />
      </div>
    </div>
  );
};

export default HomePage;
